import RouteTile from './RouteTile';
import './RouteTileContainer.css';

function RouteTileContainer() {
  return (
    <div className="route-tile-container">
      <RouteTile {...routes[0]} />
      <RouteTile {...routes[1]} />
      <RouteTile {...routes[2]} />
      <RouteTile {...routes[3]} />
      <RouteTile {...routes[4]} />
      <RouteTile {...routes[5]} />
    </div>
  );
}

export default RouteTileContainer;
